import classes from "./navBar.module.css"

const navBar = (props) => {
    const navBarStyle = `${classes.navbar_text_style} ${classes.navbar_display_style}`;

    return (
        <nav className={navBarStyle}>
            <li>Accueil</li>
            <li>A Propos</li>
        </nav>
    )
};

export default navBar;
